import React, { useState } from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';

const App = () => {
  return (
    <>
    <div>
    
      <h1 className="text-xl-start" style={{display:"inline-block"}}>
      Keep Note </h1>
      
      <img src="kp.jpg" alt="" srcset="" height="100px" width="100px" />
      </div>
     
    </>
  );
};
export default App;
